Barsplot with gnuplot. Commands:
load(descriptive);

x:[A,B,B,C,A,A,A,D,B,A,A,B,C,C,A,D,C,B,A,A,A,A,B,B,C,D];

barsplot(x,bars_colors  = [grey],fill_density = 0.5,relative_frequencies = true,title="Marrazteko programei buruzko 

 ikerketa",xlabel="Programa",ylabel="Ikasleen portzentajea");

Barchart for a discrete variable with gnuplot via Maxima. Commands:
x=[0,1,1,2,2,3,1,2,2,2,0,1,2,2,2,3,5,6,2,2,2,2,1,1,0,1,2,2,3,2];

barsplot(x,title="15-24 urte bitarteko gazteen musika-kontsumoa",
relative_frequencies = true, fill_density=0.3, bars_colors = [blue],        

 xlabel="Ordaindutako kontzertu kopurua",ylabel="Proportzioa");
